import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';  // ใช้สไตล์จากไฟล์ index.css

function App() {
  return (
    <div className="App">
      <h1>Welcome to Volunteer Management</h1>
      <p>This is a sample React app for managing volunteer data.</p>
    </div>
  );
}

// Render the App component to the root element
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root') // จุดที่ React จะแสดงผล
);
